window.bookSummaryJSON = "<p><b>Survival rests in the hands of a madwoman…</b></p> <p>Leaving behind the capital and all the changes he wrought there, Sen ventures back into the deep wilds in search of the mad, nascent soul cultivator, Fu Ruolan. It is a final, desperate bid to find the manual he needs to complete his body cultivation.<br> <br> Of course, in the world of cultivation, things are rarely as straightforward as they seem. Madness takes many shapes, and Fu Ruolan is no exception to this truth. With everything on the line, though, Sen finds himself reluctantly agreeing to a deal that he may well live to regret.</p>"; 
